bool is_palindrome(string &s,
      int start,
      int end,
      vector<vector<int> > &pal_statuses) {
    if (start >= end) {
      if (start == end) {
        pal_statuses[start][end] = 1;
      }

      return true;
    }
    else {
      if (pal_statuses[start][end] != 0) {
        return (pal_statuses[start][end] > 0);
      }
      else {
        if (s[start] != s[end]) {
          pal_statuses[start][end] = -1;

          return false;
        }
        else {
          if (is_palindrome(s, start + 1, end - 1, pal_statuses)) {
            pal_statuses[start][end] = 1;
          }
          else {
            pal_statuses[start][end] = -1;
          }
        }

        return (pal_statuses[start][end] > 0);
      }
    }
  }

